import React from 'react';

const WelcomePage = () => {
    return (
        <div className="welcome">
            <h1>Добро пожаловать в приложение Силант!</h1>
            <p>Здесь вы можете управлять машинами, обслуживания и рекламациями.</p>
        </div>
    );
};

export default WelcomePage;
